function Frist() {
    const parsons = [
        {
            name: 'Jhon',
            age: 28,
            city: 'HO'
        },
        {
            name: 'Onhj',
            age: 82,
            city: 'HN'
        },
        {
            name: 'Nohj',
            age: 41,
            city: 'IT'
        }
    ];
    const parsonlist = parsons.map(parson => 
    <h1>my name is a {parson.name}
     my age is {parson.age}
      and , i am from 
      {parson.city}
      </h1>)
    return (
        <div>
            {
                parsonlist
            }
        </div>
    )
}

export default Frist;
